import React from 'react'

function Search() {
  return (
    <div className='container-md contianer-fluid py-5'>
        <br /><br /><br />
        <div className='content'>
            <p className='lead text-light fw-bold display-6'>Find your <span className='fw-bolder'>dream job</span>, Build your <br/>
            <span className='fw-bolder'>network</span> or Hire the <span className='fw-bolder'>best talents!</span></p>
        </div>
    </div>
  )
}

export default Search
